import React from 'react';

const fallLogo = require('./images/fall.jpg')

const SeasonDisplay = () => {
	return (
		<div style={{ height: 200, width: 200, textAlign: 'center', }}>
			<img src={`url(${fallLogo})`} />
			<p>SeasonDisplay</p>
		</div>

	);
};

export default SeasonDisplay;
